            'brand_text' => '<p><strong>Bosch</strong>&nbsp;(полное наименование&nbsp;<strong>Robert Bosch GmbH</strong>)&nbsp;&mdash;&nbsp;немецкая&nbsp;транснациональная&nbsp;инженерная и&nbsp;технологическая&nbsp;компания. Штаб-квартира находится в&nbsp;Герлингене, недалеко от&nbsp;Штутгарта,&nbsp;Германия.</p>

<p>Основные направления деятельности Bosch охватывают четыре бизнес-сектора: автомобильные технологии (оборудование и программное обеспечение), потребительские товары (бытовая техника и электроинструменты), промышленные технологии (электроприводы и системы управления), а также энергетику и строительные технологии. Благодаря своему автомобильному подразделению, на долю которого в 2020 году приходилось 59&nbsp;% продаж, Bosch является крупнейшим в мире поставщиком автомобильного оборудования и запчастей.</p>

<p>В списке крупнейших компаний&nbsp;Fortune Global 500&nbsp;за 2022 год Bosch заняла 108-е место.</p>

<p>В Группу компаний Bosch входят Robert Bosch GmbH и примерно 440 дочерних предприятий и региональных компаний приблизительно в 60 странах. Вместе с партнёрами в сфере продаж и обслуживания компания Bosch представлена почти в 150 странах.</p>',
