                'iscommercialvehicle' => 'False',
                'brand_text' => '<p>История компании Quattro Freni начинается в 1990&nbsp; году в итальянском городе Милан, когда у группы представителей из нескольких европейских компаний появилась идея наладить совместное производство запасных частей. Коллективный бренд &laquo;Quattro Freni&raquo;, который сформировался уже много позже, возник именно потому что каждая из компаний-участников могла предоставить необходимые ресурсы для организации подобного вида производства.</p>

<p>Следующим шагом был выход продукции &laquo;Quattro Freni&raquo; на международную арену, которая не была бы ограничена лишь западной Европой. Представители QF решили провести экспертную оценку российского рынка запасных частей, а также оценить перспективы выхода на него. В итоге было принято решение о реорганизации и оптимизации производства.</p>

<p>Одним из первых провёл реконструкцию завод МарКон, что позволило создать на его базе современное производство запасных частей премиального качества по европейским стандартам Quattro Freni.</p>

<p>Более чем 20-летний опыт работы с оригинальным оборудованием позволяет компании &laquo;Quattro Freni&raquo; проектировать и изготавливать современные детали и системы для автомобилей ведущих мировых производителей, которые не уступают оригинальным по своим рабочим и техническим характеристикам.</p>

<p>Существующие стандарты качества и финансовые вложения (инвестиции) сделанные в эту область производства значительно стимулировали творческий потенциал Компании и позволили ей занять достойное место среди производителей запчастей.</p>

<p>Клиенты компании получают запасные части, которые по форме и функциональным качествам идеально подходят для их автомобилей: двигателей и топливных систем, рулевых систем и подвесок, тормозных систем, систем отопления и кондиционирования.</p>

<p>Качество конечной продукции подтверждается регулярным прохождением контроля:</p>

<ul>
<li>Немецкой компанией DQS осуществляется аудит, призванный оценить соответствие организации производства международному стандарту ИСО 9001;</li>
<li>Также проходит обязательная сертификация продукции в РФ в НАМИ-ФОНД, городе Москва.</li>
</ul>

<p>Помимо комплектующих самого высокого качества компания обеспечивает полное информационное сопровождение, прилагая полную и подробную инструкцию по изделиям на русском языке.</p>

<p>Сайт компании оснащен электронным каталогом и системой заказов в режиме он-лайн.</p>

<p>Продукция &laquo;Quattro Freni&raquo; показала себя надежным спутником автомобиля.</p>

